import React, {useEffect, useState } from 'react'
import UserService from '../services/UserService'
import { useNavigate } from 'react-router-dom'

const ListUserComponent = () => {
    const [task, setTask] = useState([])
    const navigator = useNavigate();

    useEffect(() => {
        UserService().then((response) => {
            setTask(response.data);
        }).catch(error => {
            console.error(error);
        })
    },[])

    function addNewTask(){
        navigator('/add-list');
    }

        return (
            <div>
                 <h2 className="text-center">Task List</h2>
                 <div className = "row">
                    <button className="btn btn-primary" onClick={addNewTask}>Add Task</button>
                 </div>
                 <br></br>
                 <div className = "row">
                        <table className = "table table-striped table-bordered">

                            <thead>
                                <tr>
                                    <th>Id</th>
                                    <th>TaskName</th>
                                    <th>Description</th>
                                    <th>StartDate</th>
                                    <th>EndDate</th>
                                    <th>TaskStatus</th>
                                    <th>TotalEffortReq</th>
                                    <th>Actions</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    this.state.task.map(
                                        task => 
                                        <tr key = {task.id}>
                                             <td>{task.id}</td>
                                             <td> { task.taskName} </td>   
                                             <td> {task.description}</td>
                                             <td> {task.startDate}</td>
                                             <td> {task.endDate}</td>
                                             <td> {task.taskStatus}</td>
                                             <td> {task.totalEffortReq}</td>
                                             <td>
                                                 <button onClick={ () => this.editTask(task.taskStatus)} className="btn btn-info">Update</button>
                                                <button style={{marginLeft: "10px"}} onClick={ () => this.viewTask(task.id)} className="btn btn-info">View</button>
                                             </td>
                                        </tr>
                                    )
                                }
                            </tbody>
                        </table>

                 </div>

            </div>
        )
}

export default ListUserComponent;
